import React, { useContext, useEffect, useState } from "react";
import { GlobalCommunityContext } from "../community";
import CommentCard from "./CommentCard.js";

import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import IconButton from "@mui/material/IconButton";
import Button from "@mui/material/Button";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import TextField from "@mui/material/TextField";

import ExpandLessIcon from "@mui/icons-material/ExpandLess";
import ThumbUpIcon from "@mui/icons-material/ThumbUp";
import ThumbDownIcon from "@mui/icons-material/ThumbDown";
import CommentIcon from "@mui/icons-material/Comment";
import FlagIcon from "@mui/icons-material/Flag";

import SortIcon from "@mui/icons-material/Sort";

import AddIcon from "@mui/icons-material/Add";
import Fab from "@mui/material/Fab";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";

import Grid from "@mui/material/Grid";

export default function PostCard(props) {
  const { community } = useContext(GlobalCommunityContext);
  const { post, index } = props;

  const image =
    "data:image/jpeg;base64,";

  //Keeps track if post is expanded or not
  const [expanded, setExpanded] = useState(false);

  function handleExpand(event) {
    event.stopPropagation();
    let ex = !expanded;
    setExpanded(ex);
    // if (ex) {
    //   store.updateViews(top5List);
    // }
  }

  let postData = (
    <Box sx={{ height: "90%", width: "90%" }} component="img" src={image}></Box>
  );

  if (index % 2 == 1) {
    postData = (
      <Typography
        style={{
          fontSize: "22px",
        }}
      >
        There are still rusted bayonets to be found in the dirt. Alongside
        broken firearms, canteens, and bullet-struck helmets. At times, still
        attached to skeletons. The deep-sea team would occasionally find a
        corroded tank or the remains of a submarine acting as an aquarium.
        Fighter planes would turn up far off in the mountains, a surprise to
        climbers. Rare was it that Hisao found letters buried in Saipan.
      </Typography>
    );
  }

  let comms = ["J/Rage Comics", "J/Memes", "J/Random"];

  let communityName = (
    <Button
      style={{
        fontSize: "22px",
        paddingLeft: 10,
        paddingBottom: 10
      }}
    >
      {community.communityList}
    </Button>
  );

  if (community.screen == "discovery") {
    communityName = (
      <Button
        style={{
          fontSize: "22px",
          paddingLeft: 10,
          paddingBottom: 10
        }}
      >
        {comms[index]}
      </Button>
    );
  }

  const comments = post.comments;
  const commentFeed = (
    <List>
      {comments.map((comment) => (
        <ListItem key={comment}>
          <CommentCard comment={comment} />
        </ListItem>
      ))}
    </List>
  );
  if (expanded) {
    return (
      <Box
        variant="contained"
        color="success"
        size="large"
        style={{
          fontWeight: 600,
          border: "3px solid",
          borderColor: "black",
          backgroundColor: "white",
          color: "black",
          fontSize: "48px",
          borderRadius: 20,
        }}
        sx={{ mt: 2, width: "100%" }}
      >
        <Grid container justifyContent="center" alignItems="center">
          <Grid item xs={3}>
            {communityName}
          </Grid>
          <Grid item xs={3}>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.dateAndTime}
            </Typography>
          </Grid>
          <Grid item xs={3}>
            <Typography
              style={{
                fontWeight: 600,
                fontSize: "24px",
              }}
            >
              {post.postTitle}
            </Typography>
          </Grid>
          <Grid item xs={3}>
            <IconButton color="primary">
              <FlagIcon />
              <Typography>{"Report"}</Typography>
            </IconButton>
          </Grid>
          <Grid item xs={2} align="center">
            <IconButton color="primary">
              <ThumbUpIcon
                sx={{
                  width: 40,
                  height: 40,
                }}
              />
            </IconButton>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.likes.length}
            </Typography>
            <IconButton color="primary">
              <ThumbDownIcon
                sx={{
                  width: 40,
                  height: 40,
                }}
              />
            </IconButton>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.dislikes.length}
            </Typography>
            <IconButton color="primary">
              <CommentIcon
                onClick={(event) => {
                  handleExpand(event);
                }}
                sx={{
                  width: 40,
                  height: 40,
                }}
              />
            </IconButton>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.comments.length}
            </Typography>
          </Grid>
          <Grid item xs={10}>
            {postData}
          </Grid>
          <Grid item xs={12} style={{ textAlign: "center" }}>
            <IconButton color="primary">
              <ExpandLessIcon
                onClick={(event) => {
                  handleExpand(event);
                }}
                sx={{
                  width: 40,
                  height: 40,
                }}
              />
            </IconButton>
          </Grid>
          <Grid item xs={12}>
            {commentFeed}
          </Grid>
        </Grid>
      </Box>
    );
  } else {
    return (
      <Box
        variant="contained"
        color="success"
        size="large"
        style={{
          fontWeight: 600,
          border: "3px solid",
          borderColor: "black",
          backgroundColor: "white",
          color: "black",
          fontSize: "48px",
          borderRadius: 20,
        }}
        sx={{ mt: 2, width: "100%" }}
      >
        <Grid container justifyContent="center" alignItems="center">
          <Grid item xs={3}>
            {communityName}
          </Grid>
          <Grid item xs={3}>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.dateAndTime}
            </Typography>
          </Grid>
          <Grid item xs={3}>
            <Typography
              style={{
                fontWeight: 600,
                fontSize: "24px",
              }}
            >
              {post.postTitle}
            </Typography>
          </Grid>
          <Grid item xs={3}>
            <IconButton color="primary">
              <FlagIcon />
              <Typography>{"Report"}</Typography>
            </IconButton>
          </Grid>
          <Grid item xs={2} align="center">
            <IconButton color="primary">
              <ThumbUpIcon
                sx={{
                  width: 40,
                  height: 40,
                }}
              />
            </IconButton>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.likes.length}
            </Typography>
            <IconButton color="primary">
              <ThumbDownIcon
                sx={{
                  width: 40,
                  height: 40,
                }}
              />
            </IconButton>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.dislikes.length}
            </Typography>
            <IconButton color="primary">
              <CommentIcon
                sx={{
                  width: 40,
                  height: 40,
                }}
                onClick={(event) => {
                  handleExpand(event);
                }}
              />
            </IconButton>
            <Typography
              style={{
                fontSize: "22px",
              }}
            >
              {post.comments.length}
            </Typography>
          </Grid>
          <Grid item xs={10}>
            {postData}
          </Grid>
        </Grid>
      </Box>
    );
  }
}
